		private void OnPaintSample(object sender, SKPaintSurfaceEventArgs e)
		{
			int width = 2800;
			string ImageData = "data:image/jpeg;base64,";
			int height = 1800;
			canvas = e.Surface.Canvas;
			if (Device.OS == TargetPlatform.Android)
			{
				try
				{
					using (var surface = SKSurface.Create(Convert.ToInt32(width), height, SKColorType.Rgb565, SKAlphaType.Premul))
					{
						//code to draw image
						if (!string.IsNullOrEmpty(ImageData))
						{
							string strimg64 = ImageData.Split(',')[1];
							if (!string.IsNullOrEmpty(strimg64))
							{
								byte[] imageBytes = Convert.FromBase64String(strimg64);
								Stream fileStream = new MemoryStream(imageBytes);

								// clear the canvas / fill with white
								canvas.DrawColor(SKColors.White);

								// decode the bitmap from the stream
								using (var stream = new SKManagedStream(fileStream))
								using (var bitmap = SKBitmap.Decode(stream))
								using (var paint = new SKPaint())
								{
									canvas.DrawBitmap(bitmap, SKRect.Create(width, height), paint);
									//Canvas.HeightRequest = height;
									//Canvas.WidthRequest = width;
									//Canvas.InvalidateSurface();
									Content.HeightRequest = height;
									Content.WidthRequest = width;
									//GridWithGesture.HeightRequest = width;
								}
							}
						}
					}
				}
				catch (Exception ex)
				{
					throw ex;
				}
			}
			else if (Device.OS == TargetPlatform.iOS)
			{
				try
				{
					using (var surface = SKSurface.Create(Convert.ToInt32(width), height, SKColorType.Rgb565, SKAlphaType.Premul))
					{
						//code to draw image
						if (!string.IsNullOrEmpty(ImageData))
						{
							string strimg64 = ImageData.Split(',')[1];
							if (!string.IsNullOrEmpty(strimg64))
							{
								byte[] imageBytes = Convert.FromBase64String(strimg64);
								Stream fileStream = new MemoryStream(imageBytes);

								// clear the canvas / fill with white
								canvas.DrawColor(SKColors.White);

								// decode the bitmap from the stream
								using (var stream = new SKManagedStream(fileStream))
								using (var bitmap = SKBitmap.Decode(stream))
								using (var paint = new SKPaint())
								{
									canvas.DrawBitmap(bitmap, SKRect.Create(width, height), paint);
									//Canvas.HeightRequest = height;
